import './mapStyles.css'
import React from 'react';
import bus from "../images/smBus.png"
import map from "../images/map_artEd.png"

const busMap = () => {
    return (
        <div className='App'>
            <div className='App-bus-map'>
                <img src={map} />
                <img src={bus} />
            </div>
        </div>
      );
  };

  export default busMap
